import React, { useState } from 'react';
import "../styles/Register.css";

function PatientRegister() {
  const [registrationData, setRegistrationData] = useState({
    username: '',
    lastname: '',
    middlename: '',
    firstname: '',
    age: '',
    sex: '',
    birthday: '',
    address: '',
    contact: '',
    email: '',
    senior: '',
    pwd: '',
    philhealth: '',
    hmo: '',
    password: '',
    confirmPassword: '',
  });

  const [signupMessage, setSignupMessage] = useState('');
  const [showVerification, setShowVerification] = useState(false);

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setRegistrationData({
      ...registrationData,
      [name]: value,
    });
  };

  const handleSignup = async () => {
    // Check if any of the required fields are empty
    if (
      !registrationData.username ||
      !registrationData.lastname ||
      !registrationData.firstname ||
      !registrationData.age ||
      !registrationData.sex ||
      !registrationData.address ||
      !registrationData.contact ||
      !registrationData.password ||
      !registrationData.confirmPassword
    ) {
      setSignupMessage('Please fill in all required fields.');
      return;
    }

    // Add any additional validation logic here as needed

    try {
      const url = new URL('http://localhost:8080/patients');
      const response = await fetch(url, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(registrationData),
      });

      if (response.ok) {
        // Signup successful
        setSignupMessage('Patient registered successfully');
        setShowVerification(true);
      } else {
        // Signup failed
        const errorMessage = await response.text();
        setSignupMessage(`Registration failed: ${errorMessage}`);
      }
    } catch (error) {
      console.error('Error during registration:', error);
      setSignupMessage('Error during registration. Please try again later.');
    }
  };

  const handleVerificationClose = () => {
    setShowVerification(false);
  };


  return (
    <div className="reg-container" id="reg-container">
      <div className="register">
        <h1 style={{ color: '#0094d4' }}>Patient Register</h1>
        <form action="#" id="register-form">
          <div className="reg-row">
            <div className="reg-infield">
              <input
                type="text"
                id="username"
                placeholder="*Username"
                name="username"
                value={registrationData.username}
                onChange={handleInputChange}
              />
            </div>
            <div className="reg-infield">
              <input
                type="text"
                id="lastname"
                placeholder="*Last Name"
                name="lastname"
                value={registrationData.lastname}
                onChange={handleInputChange}
              />
            </div>
          </div>
          <div className="reg-row">
            <div className="reg-infield">
              <input
                type="text"
                id="middlename"
                placeholder="Middle Name"
                name="middlename"
                value={registrationData.middlename}
                onChange={handleInputChange}
              />
            </div>
            <div className="reg-infield">
              <input
                type="text"
                id="firstname"
                placeholder="*First Name"
                name="firstname"
                value={registrationData.firstname}
                onChange={handleInputChange}
              />
            </div>
          </div>
          <div className="reg-row">
            <div className="reg-infield">
              <input
                type="number"
                id="age"
                placeholder="*Age"
                name="age"
                min="1"
                max="100"
                value={registrationData.age}
                onChange={handleInputChange}
              />
            </div>
            <div className="reg-infield">
              <input
                type="text"
                id="sex"
                placeholder="*Sex"
                name="sex"
                value={registrationData.sex}
                onChange={handleInputChange}
              />
            </div>
          </div>
          <div className="reg-row">
            <div className="reg-infield">
              <input
                type="date"
                id="birthday"
                name="birthday"
                value={registrationData.birthday}
                onChange={handleInputChange}
              />
            </div>
            <div className="reg-infield">
              <input
                type="text"
                id="address"
                placeholder="*(House/Lot/Unit No., Street, Barangay, City/Town, Province)"
                name="address"
                value={registrationData.address}
                onChange={handleInputChange}
              />
            </div>
          </div>
          <div className="reg-row">
            <div className="reg-infield">
              <input
                type="text"
                placeholder="*Contact Number"
                name="contact"
                value={registrationData.contact}
                onChange={handleInputChange}
              />
            </div>
            <div className="reg-infield">
              <input
                type="email"
                placeholder="Email"
                name="email"
                value={registrationData.email}
                onChange={handleInputChange}
              />
            </div>
          </div>
          <div className="reg-row">
            <div className="reg-infield">
              <input
                type="text"
                placeholder="Senior Citizen ID Number"
                name="senior"
                value={registrationData.senior}
                onChange={handleInputChange}
              />
            </div>
            <div className="reg-infield">
              <input
                type="text"
                placeholder="PWD ID Number"
                name="pwd"
                value={registrationData.pwd}
                onChange={handleInputChange}
              />
            </div>
          </div>
          <div className="reg-row">
            <div className="reg-infield">
              <input
                type="text"
                placeholder="PhilHealth ID Number"
                name="philhealth"
                value={registrationData.philhealth}
                onChange={handleInputChange}
              />
            </div>
            <div className="reg-infield">
              <input
                type="text"
                placeholder="Health Insurance/HMO"
                name="hmo"
                value={registrationData.hmo}
                onChange={handleInputChange}
              />
            </div>
          </div>
          <div className="reg-row">
            <div className="reg-infield">
              <input
                type="password"
                placeholder="Password"
                name="password"
                value={registrationData.password}
                onChange={handleInputChange}
              />
            </div>
            <div className="reg-infield">
              <input
                type="password"
                placeholder="Re-enter Password"
                name="confirmPassword"
                value={registrationData.confirmPassword}
                onChange={handleInputChange}
              />
            </div>
          </div>
          <button onClick={handleSignup}>Register</button>
        </form>
      </div>
    </div>
  );
}

export default PatientRegister;
